import React from "react";

interface Props {
     title: string
     imageUrl: string
}

export const PopUpContent: React.FC<Props> = (Props) => {

   return (
       <div style={{display: "inline"}}>
           <img src={Props.imageUrl} alt={"Abbildung "+Props.title} />

       </div>
    )
}
